import React from 'react';
import classes from './ProfileInfo.module.css'


const ProfileInfo = () => {
    return (
        <div className={classes.content}>
            <div>
                <img
                    src="https://cdn.intesense.ru/wp-content/uploads/2018/10/2018-10-04_16-51-27_182960.jpgА" alt=""/>
            </div>
        </div>
    );
}

export default ProfileInfo;
